import{newE2EPage}from"@stencil/core/testing";import{dispose as disposeCheckout}from"../../../../../store/checkout/index";describe("sc-order-shipping-address",(()=>{beforeEach((()=>{disposeCheckout()})),it("renders",(async()=>{const e=await newE2EPage();await e.setContent("<sc-order-shipping-address></sc-order-shipping-address>");const t=await e.find("sc-order-shipping-address");expect(t).toHaveClass("hydrated")})),it("renders custom placeholders",(async()=>{const e=await newE2EPage();await e.setContent('<sc-order-shipping-address name-placeholder="name test" country-placeholder="country test" city-placeholder="city test" line-1-placeholder="line 1 test" line-2-placeholder="line 2 test" postal-code-placeholder="postal code test" state-placeholder="state test" full></sc-order-shipping-address>'),await e.waitForChanges();let t=await e.find("sc-order-shipping-address >>> sc-address"),s=await t.getProperty("placeholders");expect(s).toEqual({name:"name test",country:"country test",city:"city test",line_1:"line 1 test",line_2:"line 2 test",postal_code:"postal code test",state:"state test"})})),it("uses default country if supplied",(async()=>{const e=await newE2EPage();await e.setContent('<sc-order-shipping-address default-country="BD"></sc-order-shipping-address>'),await e.waitForChanges();let t=await e.find("sc-order-shipping-address >>> sc-compact-address"),s=await t.getProperty("address");expect(s.country).toEqual("BD")}))}));